A page can contain attachments which can then later be referenced from within a page. For example this is very useful for attaching images and displaying them in the page's content. 

= Attaching a file =

There are 3 possibilities to attach a file:

== Using the top level menu ==

Starting with XWiki 2.6, you can add an attachment using the new Add menu:

{{image reference="Features.Attachments@AddAttachmentsColibri.png"/}}

You'll see a list of the current attachments and a possibility to upload more files:

{{image reference="Features.Attachments@view-attachments.png"/}}

== Using the attachment panel at the bottom of the page ==

View the page on which you wish to attach a file and then click on "Attachments" at the bottom of the page.

{{image reference="Features.Attachments@attachments.png"/}}

== Using the WYSIWYG editor ==

Edit the page on which you wish to attach a file using the WYSIWYG editor and click on "Link > Attached File..." in the toolbar. You can also click on "Image > Attached Image" and you'll get a similar popup window as shown below:

{{image reference="Features.Attachments@AttachmentWysiwygToucan.PNG"/}}

Note that you can create a link to the attachment/image directly in that same popup window.

= Linking to an attached file/image =

If you're using the Wiki editor, you can use the [[Wiki Syntax>>platform:Main.XWikiSyntax]] to display an image inline or link to an attachment.

If you're using the WYSIWYG editor, then use the "Link > Attached File..." or "Image > Attached Image" buttons as shown above.

= Linking to an external file/image =

If your file is on a remote server and you wish to link to it from your wiki, simply use the URL of the link as the content of your wiki link. For example, using the wiki editor you'd write:

* **XWiki Syntax 1.0**: {{code language="none"}}[http://some_remote_server/path/to/file>text to display]{{/code}}
* **XWiki Syntax 2.0**: {{code language="none"}}[[text to display>>http://some_remote_server/path/to/file]]{{/code}}

For displaying an image located on a remote server, use the following HTML code snippet:

* **XWiki Syntax 1.0**: {{code language="xml"}}<img src="http://some_remote_server/path/to/image"/>{{/code}}
* **XWiki Syntax 2.0**: {{code language="none"}}image:http://some_remote_server/path/to/image{{/code}}

See the [[XWiki Syntax Guide>>platform:Main.XWikiSyntax]] for more details.

= Size Limit =

The maximum size of an attachment is limited by the administrator. By default it is set at about 32 megabytes.

= Learn More =

For more information about how XWiki attachments work and how to configure/tune the attachment store, you can examine the [[administrator's guide to attachments>>platform:AdminGuide.Attachments]].
